import './index.css';
import {Button} from "../Button";

export const ListItem = (props) => {
    const { title } = props;

    return (
        <div className="ListItem">
            <div className="ListItem-Title">{title}</div>
            <Button type="action" icon="edit"/>
            <Button type="action" icon="trash"/>
            <Button type="action">Текст</Button>
        </div>
    );
};
